import React from "react";
import { 
  FaInstagram, FaFacebookF, FaPhone, 
  FaEnvelope, FaYoutube, FaTwitch 
} from "react-icons/fa";
import { useLocation } from "react-router-dom"; // Import useLocation
import "./aboutus.css";
import Navbar from '../components/navbar';
import User_Navbar from '../components/user_navbar';

const AboutUs = () => {
  const location = useLocation(); // Get current route
  
  return (
    <div>
      {/* Conditionally render Navbar based on the route */}
      {location.pathname === "/user" ? <User_Navbar /> : <Navbar />}

      {/* About Us Section */}
      <section className="about-us-section">
        <div className="about-us-container">
          <h2 className="about-us-title">About Our Psychotherapy Consultancy</h2>
          <p className="about-us-text">
            At our psychotherapy consultancy, we empower individuals to navigate
            lifeâ€™s challenges through personalized therapy sessions. Our mission
            is to provide a safe, supportive, and confidential space where healing
            begins. Whether you're dealing with stress, anxiety, or personal
            growth, our professional therapists are here to guide you.
          </p>
        </div>

        {/* Contact & Social Links */}
        <div className="about-us-contact">
          <div className="contact-info">
            <p><FaPhone className="icon" /> +91 98765 43210</p>
            <p><FaEnvelope className="icon" /> support@psychotherapy.com</p>
          </div>

          <div className="social-media">
            <div className="social-item">
              <FaInstagram className="social-icon" />
              <span>www.instagram.com</span>
            </div>
            <div className="social-item">
              <FaFacebookF className="social-icon" />
              <span>www.facebook.com</span>
            </div>
          </div>

          <div className="streaming-links">
            <div className="social-item">
              <FaYoutube className="social-icon" />
              <span>www.youtube.com</span>
            </div>
            <div className="social-item">
              <FaTwitch className="social-icon" />
              <span>www.twitch.com</span>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default AboutUs;
